});

class Map extends Component {

  componentDidMount() {
  }

  getCoordinates(map, e) {
    console.log(e.lngLat);
  }

  render() {
    return (
      <div>
        <Mapbox 
          ref="mapbox"
          style='mapbox://styles/mapbox/streets-v9'
          containerStyle={{
            height: "100vh",
            width: "100vw"
          }} 
          onClick={this.getCoordinates}
        />
      </div>
    );
  }
}

export default Map;
